import React from "react";

const Header = () => {
  return (
    <div className="flex flex-col md:flex-row items-center justify-between min-h-screen bg-gray-100 p-6 md:p-16">
      {/* النصوص */}
      <div className="max-w-lg text-center md:text-left">
        <h1 className="text-4xl md:text-6xl font-bold text-black">I’m a Header</h1>
        <p className="text-gray-500 mt-4 text-lg">
          This is a template landing page, created with Figma and Anima. No coding involved.
        </p>
        <div className="mt-6 flex justify-center md:justify-start gap-4">
          <button className="bg-pink-500 text-white px-6 py-3 rounded-full shadow-lg hover:bg-pink-600 transition-all">
            Primary
          </button>
          <button className="border-2 border-gray-400 text-gray-700 px-6 py-3 rounded-full hover:bg-gray-200 transition-all">
            CTA
          </button>
        </div>
      </div>
      {/* صورة أو عنصر مرئي */}
      <div className="w-full md:w-1/2 flex justify-center mt-10 md:mt-0">
        <div className="w-80 h-80 bg-gray-400 rounded-lg"></div>
      </div>
    </div>
  );
};

export default Header;
